import React from "react";
import {useForm} from 'react-hook-form';
import reset from '../../assets/home/icons/reset_pass.svg';
import arrow from '../../assets/home/icons/grey_arrow-right.svg'
import { Link } from "react-router-dom";
import Login from "./Login";

export default function ResetPassword () {
    const form = useForm();

    return(
        <section className="modal">  
            <img src={reset} alt="reset password"/>
                <h1>Forgot Password</h1>
                <h4>No worries, we'll send you reset instructions.</h4>
            <form>
                <label>Email Address</label>
                <input type="email" placeholder="Enter your email address"/>
                <button className="btn_submit" type="submit">Reset Password</button>
            </form>
            <Link to="/login" element={<Login/>}>
            <img src={arrow} alt="back to login"/><button> Back to Login</button>
             </Link>
         </section>
    )
}
